<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Style Ace Branding</title>
    <style>
        .images{
            width: 90vw;
            margin: auto;
            display: flex;
           flex-direction: column;

        }
        .images video{
           
            width: 100%
        }

</head>
<body>
    <div class="images">

        <img class="img" data-aos="zoom-in" src="./Style Ace Branding/Artboard 1 (2).png" alt="">

        <img class="img" data-aos="zoom-in" src="./Style Ace Branding/Event Standy Fresh Factory copy.jpg" alt="">
        <img class="img" data-aos="zoom-in" src="./Style Ace Branding/2/Artboard 1.png" alt="">
